const initialState = {
    contacts:[]
}

const fetchContactReducer =(state=initialState, action)=>{
    switch(action.type){
        case 'FETCH_CONTACTS':{
            return [...state, contact,saction.contacts];
        }
        default:
        return state;

    }
}


export default fetchContactReducer;
